import React from "react";
import { NavLink } from "react-router-dom";
import styles from "./NavBar.module.css";

const NavBar = () => {
  return (
    <header className={styles.navbar}>
      <nav>
        <ul>
          <li>
            <Link activeClassName={styles.active} to="/planets">
              Planets
            </Link>
          </li>
          <li>
            <Link activeClassName={styles.active} to="/characters">
              Characters
            </Link>
          </li>
          <li>
            <Link activeClassName={styles.active} to="/starships">
              Starships
            </Link>
          </li>
        </ul>
      </nav>
    </header>
  );
};

export default NavBar;
